class Color{constructor(e){this.initColor(e)}initColor(e){colorMode(RGB,255),this.red=red(e),this.green=green(e),this.blue=blue(e),this.alpha=alpha(e)}getColor(){return colorMode(RGB,255),color(this.red,this.green,this.blue,this.alpha)}setColor(e){this.initColor(e)}getRed(){return this.red}getGreen(){return this.green}getBlue(){return this.blue}getAlpha(){return this.alpha}setRed(e){this.red=Math.floor(constrain(e,0,255))}setGreen(e){this.green=Math.floor(constrain(e,0,255))}setBlue(e){this.blue=Math.floor(constrain(e,0,255))}setAlpha(e){this.alpha=Math.floor(constrain(e,0,255))}}class Range{constructor(e,r){this.low=e,this.high=r}getLow(){return this.low}getHigh(){return this.high}}class ColorGenerator{getRandomColor(){return color(0)}mapColor(e,r,o,t,n){return color(0)}getName(){return"Color Generator"}}class RGBColorGenerator extends ColorGenerator{constructor(e,r,o){super(),this.redRange=e,this.greenRange=r,this.blueRange=o}getRandomColor(){colorMode(RGB,255);let e=randomInt(this.redRange.getLow(),this.redRange.getHigh()),r=randomInt(this.greenRange.getLow(),this.greenRange.getHigh()),o=randomInt(this.blueRange.getLow(),this.blueRange.getHigh());return color(e,r,o)}mapColor(e,r,o,t,n){return this.getRandomColor()}getName(){return"RGB Color Generator"}}class HSBColorGenerator extends ColorGenerator{constructor(e,r){super(),this.lowHueValue=e,this.highHueValue=r}getRandomColor(){colorMode(HSB,360);let e=randomInt(this.lowHueValue,this.highHueValue);return color(e,360,360)}mapColor(e,r,o,t,n){colorMode(HSB,360);let a=map(e,r,o,this.lowHueValue,this.highHueValue);return color(a,t,n)}getName(){return"HSB Color Generator"}}class BlackColorGenerator extends RGBColorGenerator{constructor(){super(null,null,null)}getRandomColor(){colorMode(RGB,255);let e=randomInt(0,100);return color(e)}getName(){return"Black Color Generator"}}class BlueColorGenerator extends RGBColorGenerator{constructor(){super(new Range(0,100),new Range(0,100),new Range(100,255))}getName(){return"Blue Color Generator"}}class CyanColorGenerator extends RGBColorGenerator{constructor(){super(new Range(0,100),new Range(100,255),new Range(100,255))}getName(){return"Cyan Color Generator"}}class GreenColorGenerator extends RGBColorGenerator{constructor(){super(new Range(0,100),new Range(100,255),new Range(0,100))}getName(){return"Green Color Generator"}}class MagentaColorGenerator extends RGBColorGenerator{constructor(){super(new Range(100,255),new Range(0,100),new Range(100,255))}getName(){return"Magenta Color Generator"}}class RandomColorGenerator extends RGBColorGenerator{constructor(){super(new Range(0,255),new Range(0,255),new Range(0,255))}getName(){return"Random Color Generator"}}class RedColorGenerator extends RGBColorGenerator{constructor(){super(new Range(100,255),new Range(0,100),new Range(0,100))}getName(){return"Red Color Generator"}}class WhiteColorGenerator extends RGBColorGenerator{constructor(){super(null,null,null)}getRandomColor(){colorMode(RGB,255);let e=randomInt(100,255);return color(e)}getName(){return"White Color Generator"}}class YellowColorGenerator extends RGBColorGenerator{constructor(){super(new Range(100,255),new Range(100,255),new Range(0,100))}getName(){return"Yellow Color Generator"}}class BottomColorGenerator extends HSBColorGenerator{constructor(){super(0,180)}getName(){return"Bottom Color Generator"}}class CoolColorGenerator extends HSBColorGenerator{constructor(){super(90,285)}getName(){return"Cool Color Generator"}}class RainbowColorGenerator extends HSBColorGenerator{constructor(){super(0,360)}getName(){return"Rainbow Color Generator"}}class TopColorGenerator extends HSBColorGenerator{constructor(){super(180,360)}getName(){return"Top Color Generator"}}class WarmColorGenerator extends HSBColorGenerator{constructor(){super(0,70)}getName(){return"Warm Color Generator"}}class ColorGeneratorFactory{getColorGenerator(){return new ColorGenerator}getName(){return"Color Generator Factory"}}class UniformColorGeneratorFactory extends ColorGeneratorFactory{getColorGenerator(){let e;switch(randomInt(0,14)%14){case 1:e=new BlackColorGenerator;break;case 2:e=new BlueColorGenerator;break;case 3:e=new CyanColorGenerator;break;case 4:e=new GreenColorGenerator;break;case 5:e=new MagentaColorGenerator;break;case 6:e=new RedColorGenerator;break;case 7:e=new WhiteColorGenerator;break;case 8:e=new YellowColorGenerator;break;case 9:e=new BottomColorGenerator;break;case 10:e=new CoolColorGenerator;break;case 11:e=new RainbowColorGenerator;break;case 12:e=new TopColorGenerator;break;case 13:e=new WarmColorGenerator;break;default:e=new RandomColorGenerator}return e}getName(){return"Uniform Color Generator Factory"}}class UniformRGBColorGeneratorFactory extends ColorGeneratorFactory{getColorGenerator(){let e;switch(randomInt(0,9)%9){case 1:e=new BlackColorGenerator;break;case 2:e=new BlueColorGenerator;break;case 3:e=new GreenColorGenerator;break;case 4:e=new MagentaColorGenerator;break;case 5:e=new RandomColorGenerator;break;case 6:e=new RedColorGenerator;break;case 7:e=new CyanColorGenerator;break;case 8:e=new WhiteColorGenerator;break;default:e=new YellowColorGenerator}return e}getName(){return"Uniform RGB Color Generator Factory"}}class UniformHSBColorGeneratorFactory extends ColorGeneratorFactory{getColorGenerator(){let e;switch(randomInt(0,5)%5){case 1:e=new BottomColorGenerator;break;case 2:e=new CoolColorGenerator;break;case 3:e=new RainbowColorGenerator;break;case 4:e=new TopColorGenerator;break;default:e=new WarmColorGenerator}return e}getName(){return"Uniform HSB Color Generator Factory"}}